// Select all Transactions
export const selectAllTransactions = (state) => {
    const { byId, allIds } = state.transactions;

    console.log('State.transactions:', state.transactions);

    if (!allIds || !byId) {
        console.log('Returning empty array due to missing allIds or byId');
        return [];
    }

    const transactionsArray = allIds.map(id => byId[id]);

    console.log('Returning transactions array:', transactionsArray);

    return transactionsArray;
};

